import React, { Component } from 'react'
import Banner from '../../common/OurInfastructure/banner'
import Image from '../../common/OurInfastructure/Image';


export class OurInfa extends Component {
    render() {
        return (
            <div>
                <Banner/>
                <Image/>
            </div>
        )
    }
}

export default OurInfa
